import React, { useEffect, useState } from "react";
import "./styles.scss"
import { CarModel } from "../CarModel";

export function CarList(){

    interface Car{
        cars:{
            id: number;
            name: string;
            start_range: number;
            Time_to_60: number;
            top_speed: string;
            peak_power: string;
            base_price: number
        }
    }
    const[cars, setCars] = useState<any>();

    const getCars = async() => {
        const response = await fetch(
            "http://127.0.0.1:8000/website/car-list/",
            {
                method: "GET"
            }
            );
            const data = await response.json();
            setCars(data);
        }

        useEffect(() => {
            getCars();
        }, []);
        // useEffect(() => {
            //     fetch("http://127.0.0.1:8000/website/car-list/")
            //         .then(res => {
                //             return res.json();
                //         })
                //         .then(data => {
                    //             setCars(data);
                    //         });
                    // }); 

                    return(
                        <div>
            <h1 className = "heading-list">ALL MODELS</h1>
            <CarModel cars={cars}/>
        </div>
    );
}
